class Balance {
    constructor(balance, income, expense) {
        this.balance = balance;
        this.balance = balance;
        this.income = income;
        this.expense = expense;
    }
    totalBalance() {
        return this.balance = this.income - this.expense;
    }
}
class Expense {
    constructor(amount) {
        this.amount = amount;
    }
}
class Income {
    constructor(amount) {
        this.amount = amount;
    }
}
